import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router,Route} from 'react-router-dom';
import './index.css';
import './bootstrap.min.css'; 
import './fontawesome.min.css';
import Usa from './usa/usa';
import Vatby from './vatby/vatby';
import Login from './login/login';
import Prody from './prody/prody';
import Expense from './expense/expy';
import Cusmy from './cusmy/cusmypage';
import Das from './das/das';

const routing = (
  <Router>
    <Route exact path="/" component={Login}/>
    <Route path="/usa" component={Usa}/>
    <Route path="/vatby" component={Vatby}/>
    <Route path="/prody" component={Prody}/>
    <Route path="/cusmy" component={Cusmy}/>
    <Route path="/das" component={Das}/>
    <Route path="/expy" component={Expense}/>

  </Router>
);


ReactDOM.render(routing, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA


